import {
  AiOutlinePlusCircle,
  AiOutlineMinusCircle,
  AiOutlineClear,
} from "react-icons/ai";

const Counter = () => {
  var count = 0;

  return (
    <p>
      Cliques: {count} vezes <AiOutlinePlusCircle /> <AiOutlineMinusCircle />{" "}
      <AiOutlineClear />
    </p>
  );
};

export default Counter;
